import Nav from "../Nav/Nav";
import Footer from "../Footer/Footer";
import Calendar from "../Calendar/Calendar";
import About from "../About/About";

export default function Home() {
  return (
    <div className="App">
      <Nav />
      <main>
        <h1>Welcome</h1>
        {/* On Home you can include Calendar and About */}
        <Calendar />
        <About />
      </main>
      <Footer />
    </div>
  );
}
